import React, { useState } from "react";
import emailjs from "emailjs-com";
import { motion } from "framer-motion";
import logo from "./assets/logo.png";
import successImage from "./assets/success.png";
import qr from "./assets/qr.png";

const plans = [
  {
    title: "Single Talk Session",
    duration: "35 minutes",
    validity: "1 Day",
    sessions: "1 session",
    price: "₹99",
  },
  {
    title: "One Deep Session",
    duration: "60 minutes",
    validity: "1 Day",
    sessions: "1 session",
    price: "₹149",
  },
  {
    title: "Monthly VIP Plan (Short)",
    duration: "30 min × 6 sessions",
    validity: "30 Days",
    sessions: "Weekly support + 2 extras",
    price: "₹700",
  },
  {
    title: "Monthly VIP Plan (Full)",
    duration: "60 min × 7 sessions",
    validity: "30 Days",
    sessions: "Intensive full recovery plan",
    price: "₹1500",
  },
];

const FadeIn = ({ children }) => (
  <motion.div
    initial={{ opacity: 0, y: 20 }}
    whileInView={{ opacity: 1, y: 0 }}
    viewport={{ once: true }}
    transition={{ duration: 0.6 }}
  >
    {children}
  </motion.div>
);

function App() {
  const [formData, setFormData] = useState({
    name: "",
    occupation: "",
    email: "",
    whatsapp: "",
    datetime: "",
    topic: "",
    image: null,
  });
  const [submitted, setSubmitted] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    emailjs
      .send(
        "service_ted5m2h",
        "template_5qmfosa",
        {
          name: formData.name,
          email: formData.email,
        },
        "D8Cr-U9g1MVqsc5bv"
      )
      .then(() => console.log("User notified"));
    emailjs
      .send(
        "service_ted5m2h",
        "template_nzvxr9o",
        {
          name: formData.name,
          email: formData.email,
        },
        "D8Cr-U9g1MVqsc5bv"
      )
      .then(() => console.log("Admin alerted"));
    setSubmitted(true);
  };

  return (
    <div className="bg-gradient-to-b from-[#e9fcfb] to-white text-gray-900 font-sans scroll-smooth">
      {/* Booking */}
      <FadeIn>
        <section className="py-12 px-6 bg-[#f7fffe]" id="book">
          <div className="max-w-6xl mx-auto flex flex-col md:flex-row gap-8">
            <div className="md:w-2/3 bg-white p-6 rounded-xl shadow-lg">
              <h3 className="text-2xl font-semibold text-teal-700 mb-4 text-center">
                Book a Session
              </h3>
              {!submitted ? (
                <form className="space-y-4" onSubmit={handleSubmit}>
                  <input type="text" placeholder="Your Name" required className="w-full p-3 border rounded-lg" onChange={e => setFormData({ ...formData, name: e.target.value })} />
                  <input type="text" placeholder="Current Occupation" required className="w-full p-3 border rounded-lg" onChange={e => setFormData({ ...formData, occupation: e.target.value })} />
                  <input type="email" placeholder="Your Email" required className="w-full p-3 border rounded-lg" onChange={e => setFormData({ ...formData, email: e.target.value })} />
                  <input type="tel" placeholder="WhatsApp Number" required className="w-full p-3 border rounded-lg" onChange={e => setFormData({ ...formData, whatsapp: e.target.value })} />
                  <input type="datetime-local" required className="w-full p-3 border rounded-lg" onChange={e => setFormData({ ...formData, datetime: e.target.value })} />
                  <textarea placeholder="What do you want to talk about?" required className="w-full p-3 border rounded-lg" rows={3} onChange={e => setFormData({ ...formData, topic: e.target.value })}></textarea>
                  <input type="file" accept="image/*" required className="w-full p-3 border rounded-lg" onChange={e => setFormData({ ...formData, image: e.target.files[0] })} />
                  <button type="submit" className="w-full bg-teal-600 text-white py-3 rounded-lg hover:bg-teal-700 transition">
                    Submit
                  </button>
                  <p className="text-sm text-center text-gray-600 mt-2">
                    Our team will contact you after payment confirmation — usually within a few minutes to a few hours. Thank you for your patience.
                  </p>
                </form>
              ) : (
                <motion.div initial={{ opacity: 0, scale: 0.8 }} animate={{ opacity: 1, scale: 1 }} transition={{ duration: 0.5 }} className="text-center">
                  <h4 className="text-green-600 text-xl font-semibold mb-2">Form submitted!</h4>
                  <img src={successImage} alt="Success" className="mx-auto w-32" />
                </motion.div>
              )}
            </div>
            <div className="md:w-1/3 text-center">
              <h4 className="text-xl font-semibold text-teal-700 mb-4">Scan to Pay</h4>
              <img src={qr} alt="QR Code" className="w-48 mx-auto rounded-xl shadow-lg" />
            </div>
          </div>
        </section>
      </FadeIn>
    </div>
  );
}

export default App;
